    const myNavStyles = {
        display: "inline-block",
        width: "50px",
        padding: "12px",
        margin: "0 6px 6px",
        background: "blue",
        textDecoration: "none",
        color: "white",
      };
    return (
        <div className="navbar">
            <NavBar bg="myOrange" variant="dark">
                <NavBar.Brand>
                    Snap Foods
                </NavBar.Brand>
                <Nav>
                    <NavLink
                        to="/"
                        exact="true"
                        style={myNavStyles}
                        activeClassName={
                            {background: "green"}
                        }
                    >
                        Home
                    </NavLink>
                    <NavLink
                        to="/RestaurantsList"
                        exact="true"
                        style={myNavStyles}
                        activeClassName={
                            {background: "green"}
                        }
                    >
                        RestaurantsList
                    </NavLink>
                    <NavLink
                        to="/Restaurant"
                        exact="true"
                        style={myNavStyles}
                        activeClassName={
                            {background: "green"}
                        }
                    >
                        Restaurant
                    </NavLink>
                </Nav>

                {/* <Nav
